import React from 'react';
import {useState} from 'react';
import { Outlet, Link } from "react-router";
import '../style.css'
export default function Page1() {

    let emptyInputs = true;
    const [error, setError] = useState('');
    const [inputs, setInputs] = useState({});
    const handleChange = (event) => {
        const name = event.target.name;
        const value = event.target.value;
        setInputs(values => ({...values, [name]: value}))
      }

      const handleSubmit = (event) =>
      {
        if (!inputs.username || !inputs.password){
            setError("Please enter a username and password.");        
        }
        else
        { 
            emptyInputs = false;
            setError(''); 
        }

}
    return(
        <div>
            <header>
                <h1>MedLab Registration Form</h1>
            </header>
            <form onSubmit>
            <h2>Create account</h2>
            <main>
            <label className="labelpage1">Username</label>
                <input 
                    type="text"
                    name="username"
                    value={inputs.username || ""} 
                    onChange={handleChange}
                />
                <br/><br/>
                <label className="labelpage1">Password</label>
                <input 
                    type="password"
                    name="password"
                    value={inputs.password || ""} 
                    onChange={handleChange}
                />
                 {error && <p style={{ color: 'red', fontSize : '1.5em',fontWeight:'bold'}}>{error}</p>}
            </main>
                <br/><br/>
                <nav>
                    <Link to="/page2" >
                        <input className="button" type="submit" value="Next" onClick={handleSubmit} />
                    </Link>
                </nav>
                
            </form>
            <footer style={{position:"fixed"}}>
                    <div id="address">MedLab Medical Clinics of America <br/>
                         1074 Jadewood Drive, Suite 330 <br/>
                         Chicago, Illinois 60647 <br/>
                    </div>
                     <div id="contact">
                         Phone: 630-921-0000 <br/>
                         Fax: 773-709-3312
                    </div>
             </footer>
        </div>
        
    )
}
